import '../css/Elements.css'
import ElementComponent from '../components/ElementsCompo'
const Elements = [
    // 원소 배열 예시 (실제로는 전체 원소 정보를 추가해야 합니다.)
    {
        atomicNumber: 1,
        symbol: "H",
        name: "Hydrogen",
        atomicWeight: "1.008"
    },
    // ... 다른 원소들
];

function App() {
    return (
        <div className="periodic-table">
            {Elements.map(Elements => <ElementComponent key={Elements.atomicNumber} Elements={Elements} />)}
        </div>
    );
}

export default App;
